CREATE TABLE `dep` (
  `dep_name` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `dep_no` int(11) NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`dep_no`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

CREATE TABLE `eng_contact` (
  `eng_no` int(11) NOT NULL,
  `eng_contact` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  KEY `eng_no` (`eng_no`),
  CONSTRAINT `eng_contact_ibfk_1` FOREIGN KEY (`eng_no`) REFERENCES `engineer` (`eng_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

CREATE TABLE `tec_contact` (
  `t_no` int(11) NOT NULL,
  `t_contact` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  KEY `t_no` (`t_no`),
  CONSTRAINT `tec_contact_ibfk_1` FOREIGN KEY (`t_no`) REFERENCES `technician` (`t_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
